void udp_ip_tx::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"myIP_V\" :  \"" << myIP_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dst_ip_V\" :  \"" << dst_ip_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dst_mac_V\" :  \"" << dst_mac_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"src_port_V\" :  \"" << src_port_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"dst_port_V\" :  \"" << dst_port_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"arp_status_V\" :  \"" << arp_status_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_data_V\" :  \"" << payload_in_data_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_keep_V\" :  \"" << payload_in_keep_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_valid_V\" :  \"" << payload_in_valid_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_in_last_V\" :  \"" << payload_in_last_V.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"payload_in_ready_V\" :  \"" << payload_in_ready_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_data_V\" :  \"" << payload_out_data_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_keep_V\" :  \"" << payload_out_keep_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_valid_V\" :  \"" << payload_out_valid_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"payload_out_last_V\" :  \"" << payload_out_last_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"payload_out_ready_V\" :  \"" << payload_out_ready_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"action_out\" :  \"" << action_out.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"action_out_we_V\" :  \"" << action_out_we_V.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

